import web from "../src/images/s1.jpg";
import app from "../src/images/app.jpeg";
import android from "../src/images/android.jpeg";
import mushroom from "../src/images/mushroom.png";
import form from "../src/images/form.png";
import bootstrap4 from "../src/images/bootstrap4.png";

const Sdata = [
  {
    imgsrc: web,
    title: "web development",
  },
  {
    imgsrc: app,
    title: "App development",
  },
  {
    imgsrc: bootstrap4,
    title: "Gallery website",
    content:"Website useing raw html and bootstrap 4, completely responsive"
  },
  {
    imgsrc: mushroom,
    title: "Mushroom website",
    content:"simple single page html & css responsive website"
  },
  {
    imgsrc: android,
    title: "Android development",
  },
  {
    imgsrc: form,
    title: "Form verification",
    content:"Custom hooks for form verification & css gradient colors"
  },
];

export default Sdata;
